(1, 'Profesional Especializado', 'Diseñar, controlar y ejecutar procesos, procedimientos, planes, programas y proyectos propios del registro y selección de operadores para garantizar la efectividad en el ejercicio de la Entidad en cumplimiento de la misión, las metas, políticas y objetivos de la misma.', 'Tres (3) años de experiencia profesional relacionada con las funciones a desempeñar.', '2010', 5000871, '19', 1, 1),
(2, 'Profesional Especializado', 'Organizar, controlar y ejecutar procesos, procedimientos, planes, programas y proyectos relacionados con la Regional, para contribuir desde su especialidad al ejercicio de la Representación Judicial de Víctimas dentro del marco de la Entidad en cumplimiento de la misión, las metas, políticas y objetivos de la misma.', 'Un (1) año de experiencia profesional  relacionada con las funciones a desempeñar.', '2010', 4312908, '17', 1, 1),
(3, 'Profesional Especializado', 'Ejecutar procesos, procedimientos, planes, programas, proyectos y aplicar los conocimientos del área de la Psicología en desarrollo de la estrategia de orientación psicojurídica a las víctimas, en procura de la realización de los derechos a la verdad, justicia y reparación integral, para garantizar la efectividad de los Derechos Humanos en cumplimiento de la misión, las metas, políticas  y objetivos de la Entidad.', 'Un (1) año de experiencia profesional relacionada con las funciones a desempeñar.', '2010', 4312908, '17', 1, 1),
(4, 'Profesional Especializado', 'Ejecutar procesos, procedimientos, planes, programas y proyectos relacionados con el funcionamiento de la Regional en materia de prevención, protección y atención de los derechos de la población en riesgo de desplazamiento forzado, cruce forzado de fronteras y víctimas del desplazamiento forzado, en cumplimiento de la misión, las metas, políticas y objetivos de la Entidad, para garantizar la efectividad de los Derechos Humanos.', 'Un (1) año de experiencia profesional relacionada con las funciones a desempeñar.', '2010', 4312908, '17', 2, 1),
(5, 'Profesional Especializado', 'Aplicar conocimientos propios de la carrera profesional respectiva participando en el diseño y ejecución de acciones, planes, programas y proyectos de la Regional para garantizar la efectividad de los Derechos  Humanos en cumplimiento de la misión, las metas, políticas y objetivos de la Entidad.', 'Un (1) año de experiencia profesional relacionada con las funciones a desempeñar.', '2050', 3311896, '15', 2, 1),
(6, 'Profesional Especializado', 'Diseñar, controlar y ejecutar planes, programas y proyectos relacionados Dirección de Recursos y Acciones Judiciales para garantizar la efectividad de los Derechos Humanos en cumplimiento de la misión, las metas, políticas y objetivos de la Entidad.', 'Tres (3) años de experiencia profesional relacionada con las funciones a desempeñar.', '2010', 5000871, '19', 1, 1),
